import React from "react";
import {Link} from 'react-router-dom';

const Card = ({data}) => {
    return ( 
       <>
       {data.map((card, index) => (
           <div key={index} className="card">
               <h4>{card.name}</h4>
               <p>@{card.username}</p>
               <a href="#">{card.website}</a>
               <Link to={`/cards/${card.name}`}>More Details</Link>
           </div>
       ))}
       </>
    );
}

export default Card;
